import { useContext } from "react";
import { Routes, Route, Link } from "react-router-dom";
import { ThemeContext } from "./contexts/theme";
import Header from "./components/Header/Header";
import About from "./components/About/About";
import Projects from "./components/Projects/Projects";
import Skills from "./components/Skills/Skills";
import ScrollToTop from "./components/ScrollToTop/ScrollToTop";
import Contact from "./components/Contact/Contact";
import Footer from "./components/Footer/Footer";
import "./App.css";

const App = () => {
  const [{ themeName }] = useContext(ThemeContext);

  return (
    // <div className="App">
    //   <h1>Welcome to React Router!</h1>
    //   <Routes>
    //     <Route path="/" element={<HomeT />} />
    //     <Route path="about" element={<About />} />
    //   </Routes>
    // </div>

    <div id="top" className={`${themeName} app`}>
      <Header />
      {/* 
      <main>
        <About />
        <Projects />
        <Skills />
        <Contact />
      </main> */}

      <Routes>
        <Route path="/" element={ <HomePage />}  />

        <Route path="fifa-autobidder" element={<Autobidder />} />
        <Route path="fifa-autobidder/manual" element={<Autobidder />} />

      </Routes>

      <ScrollToTop />
      <Footer />
    </div>
  );
};

export default App;

function HomePage() {
  return (
    <>
      <main>
        <About />
        <Projects />
        <Skills />
        <Contact />
      </main>
    </>
  );
}


function Autobidder() {
  return (
    <>
      <main>
        <h1>FIFA 22 Autobidder</h1>

        <div className="instructions">
        <p style="text-align: right;">&nbsp;</p>
<p style="text-align: right;">Updated 2/10/22</p>
<p>A completed "cycle" takes around 20 minutes and consists of 4 steps:</p>
<ol>
<li>parsing Futbin for player prices</li>
<li>bidding on the Transfer Market,</li>
<li>handling the Transfer List (clearing sold, relisting expired),</li>
<li>handling the Watch List (clearing expired auctions, listing won players)</li>
</ol>
<p>The number of cycles is determined by <strong>num_cycles</strong>, with a <strong>sleep_time </strong>in minutes between each full cycle (completing steps 1 through 4) as a precaution to avoid a softban</p>
<ol>
<li>Parsing Futbin for player prices</li>
<ol>
<li>Bot searches using input Futbin URL on line 111 in autobidder.py which can be updated while existing bot thread is closed (thread is closed if GUI is grey, and not green - no need to re-login to change your setup)</li>
<li>Player data and cards are stored to <em>player_list.txt</em></li>
<li><span style="text-decoration: underline;"><strong>NOTE</strong></span>: <strong>futbin_max_price </strong>was never implemented and does not do anything (it was meant to ignore players during parsing but I never got around to it, so manually include the price cap in your futbin URL</li>
<li><span style="text-decoration: underline;"><strong>NOTE</strong></span>: <strong>futbin_position</strong> was never implemented and does not do anything</li>
</ol>
<li>Bidding</li>
<ol>
<li>Bot attempts to make 50 bids (the maximum watchlist size) in up to 30 distinct "searches":</li>
<ol>
<li>clicks the search button</li>
<li>parses all cards on page</li>
<li>bids on those which if Won should sell for a post-tax profit greater than or equal to the <strong>margin</strong></li>
<li>Clicks next page</li>
<li>Repeats steps i through iv until card expiring at or above <strong>expiration_cutoff_mins </strong>is detected</li>
</ol>
<li>The bot will return to the Search the Transfer Market page, and make a new search, and repeat the above until watchlist is full or 30 request limit is hit (as safety precaution, bot in theory could make infinite searches as result of user error ie mismatch between input search params + futbin URL, or extreme market caching)</li>
<li>Recommended <strong>expiration_cutoff_mins </strong>is 3</li>
</ol>
<li>Handling Transfer List</li>
<ol>
<li>Sold players are cleared and logged to logs.csv</li>
<li>Expired players are relisted based on <strong>undercut_market_on_relist:</strong></li>
<ol>
<li>0 = relisted for same failed price</li>
<li>1 = relisted for -50 or -100 (if &gt;1k) failed price</li>
<li>2 = relisted for -100 or -200 (if &gt;1k) failed price etc.</li>
</ol>
</ol>
<li>Handling Watch List</li>
<ol>
<li>Bot waits for all auctions to expire (if applicable). This is where <strong>expiration_cutoff_mins</strong> during your bidding can bite you - if is high, for example 10 minutes, you might have to waste 5 minutes waiting for the last player expire (assuming it took 5 minutes to finish handling the transfer list), ie you are waiting 5 minutes to make just 100 coins</li>
<li>Expired players (lost) are cleared and logged to logs.csv</li>
<li>Won players are listed based on <strong>undercut_market_on_list:</strong></li>
<ol>
<li>0 = listed for market price via player_list.txt</li>
<li>1 = listed for -50 or -100 (if &gt;1k) market price</li>
<li>2 = listed for -100 or -200 (if &gt;1k) market price etc.&nbsp;</li>
</ol>
<li>If for some reason player is not on player_list.txt (happens if you get backed up with too many players selling), bot will flag this and auto list for its bought price</li>
<li>Bot then sleeps <em>x</em> minutes set in <strong>sleep_time</strong> and repeats all the above <em>n</em><strong>num_cycles</strong></li>
</ol>
</ol>        
